def palindromeIndex(s)
    rev = s.reverse
    return -1 if s==rev

    for x in 0..s.length
        if s[x] != rev[x]
            ss = s.split('')
            ss.delete_at(x)
            return x if ss.eql?(ss.reverse) 
            s_rev = s.split('')
            s_rev.delete_at(s.length- x)
            return (s.length-x) if s_rev.eql?(s_rev.reverse) 
        end
    end
end



